// Skills.js
import React from 'react';

function Skills() {
  return (
    <section id="skills">
      <h2>Programming Languages and IDES </h2>
      <ul className="creative-skills-list">
        
      <li><img src="./images/python.svg" alt="Python Logo" style={{ width: '100px', height: '100px' }} /></li>
      <li><img src="./images/R.svg" alt="R Logo" style={{ width: '100px', height: '100px' }} /></li>
      <li><img src="./images/php.svg" alt="PHP Logo" style={{ width: '100px', height: '100px' }} /></li>
      <li><img src="./images/CPlusPlus.svg" alt="C Logo" style={{ width: '100px', height: '100px' }} /></li>
      <li><img src="./images/csharp.svg" alt="C# Logo" style={{ width: '100px', height: '100px' }} /></li>
      <li><img src="./images/java.svg" alt="Java Logo" style={{ width: '100px', height: '100px' }} /></li>
      <li><img src="./images/JS.svg" alt="JavaScript Logo" style={{ width: '100px', height: '100px' }} /></li>
      <li><img src="./images/kotlin.svg" alt="Kotlin Logo" style={{ width: '100px', height: '75px' }} /></li>
      <li><img src="./images/visual-studio-code.svg" alt="VS Logo" style={{ width: '100px', height: '100px' }} /></li>
      
        
      </ul>
    </section>
  );
}

export default Skills;
